		//optimal, but hard to follow
		class Solution
		{
			public int Jump(int[] nums)
			{
				int n = nums.Length, step = 0, start = 0, end = 0;
				while (end < n - 1)
				{
					step++;
					int maxend = end + 1;
					for (int i = start; i <= end; i++)
					{
						if (i + nums[i] >= n - 1) return step;
						maxend = Math.Max(maxend, i + nums[i]);
					}
					start = end + 1;
					end = maxend;
				}
				return step;
			}
		}

